import PropTypes from 'prop-types';

function Button({
     children,
    primary,
    secondary,
    success, 
    warning,
    danger,
    outline,
    rounded
    }) {
    return <button>{ children }</button>;
};

Button.propTypes = {
    primary
};

export default Button;
